import { IListTaskItemProps } from "../../types/types";
import StatusCardItem from "../statusCardItem/StatusCardItem";

const ListTaskItem: FC<IListTaskItemProps> = ({ list = [] }) => {
  return (
    <Fragment>
      <StatusCardItem />
    </Fragment>
  );
};

export default ListTaskItem;
